pragma solidity ^0.4.23;

import "./StandardNAT.sol";

contract NAT is StandardNAT {
  string name_;
  string symbol_;
  uint256 decimals_;

  constructor () public {
    name_ = "NAT";
    symbol_ = "NAT";
    decimals_ = 0;
  }

  function name() public view returns (string) {
    return name_;
  }

  function symbol() public view returns (string) {
    return symbol_;
  }

  function decimals() public view returns (uint256) {
    return decimals_;
  }

}
